import React from 'react';
import {robots} from './robots.js';
import Card from './Card.js';

const CardArray=robots.map((obj,ind)=>{
		return(
			<Card key={ind} info={obj} />
		);
});
const Cardlist=()=>{
	return(
		<div>
			{CardArray}
		</div>
	);
}
export default Cardlist;
